import React from "react";
import "../assets/css/compeounder.css";
import Header from "../components/Header";
import Footer from "../components/Footer";
import "../assets/css/innerstyle.css"; // Assuming you have a CSS file for styling
import RelationPage from "../components/Bussiness/Relation";
import MotivePage from "../components/Bussiness/Motive"; // Assuming you have a CSS file for styling
import StaffSolutionPage from "../components/Bussiness/StaffSolution"; // Assuming you have a CSS file for styling      
import EquipmentSolutionPage from "../components/Bussiness/EquipmentSolution";
const BussinessPage = () => {
    return (
        <>
        <Header />
           <RelationPage />
           <MotivePage />
           <StaffSolutionPage />
           <EquipmentSolutionPage />
            <section className="solution-wrapper-sec1">
                <div className="container">
                    <div className="row">
                        <div className="col-md-12">
                            <p>
                                Unlock the full potential of your organization with our B2B services designed to liberate you from non-core tasks. Leveraging connections within the platform community and their cumulative experience, we can heavy lift your operational burden, allowing you to maximize your productivity and innovation. Partner with us to transform your business potential into reality.
                            </p>
                        </div>
                    </div>
                </div>
            </section>
        <Footer />
        </>
    );
    }

    export default BussinessPage;
